(function execute(inputs, outputs) {
    var utils = new AppointmentUtilsPractice();
    var app = utils.allAppointments(inputs.patient_id);

    if (app) {
        outputs.date = app.u_appointment_date || '';
        outputs.appo = app.sys_id || '';
    } else {
        outputs.date = '';
        outputs.appo = '';
    }
})(inputs, outputs);

